  b 01.10.1965
  b ** ** ****
  Kerry b. at Kawakawa. Address: Pakaraka, RD 2, Kaikohe.
  Kerry was educated at King's College and is a beef farmer on the H and J Williams Grant.
  01> LUDBROOK, Peter Henry Whibley m on 22.06.1985 to (2)LEWIN, Noeline Mary
  Theresa
  b 04.07.1928 d 23.09.1997
  b 01.12.1934
  Peter bd, at the Holy Trinity graveyard. Noeline, a widow, nee Murphy, b. at Pahiatua. Address: Wiroa
  Road, RD 3, Kerikeri.
  Peter was a breeder of stud Romney sheep and Murray Grey cattle on "Pouerua" at Pakaraka. He was an
  inspector of both breeds and served as Chairman of both Breeders Clubs in Northland. He was a life
  member of the Bay of Islands Pastoral and Industrial Show Association and he and Noeline were actively
  involved in preparations to celebrate the 150th anniversary in 1992. Peter was also a member of the
  Henry and William Williams Descendant's Commemoration Trust.
  02> LUDBROOK, Caroline m on 30.05.1953 to AVERILL, George Rochford Hanson
  b 22.06.1929
  b 02.01.1927
  Caroline b. at Pakaraka and m. at Holy Trinity Church, Pakaraka. Divorced 1979. Hanson, slo Leonard
  Rochford Averill (farmer) and Catherine Lucy Coleman. Address: 1/508 Frimley Road, Hastings.
  Caroline was educated at Pakaraka Primary School, Cornwall Park Primary School, Epsom Girls' Grammar
  School and Otago University (BHSC) then trained as a dietician at the Auckland Hospital. She is
  involved with Red Cross, U3A and adult day care. Hanson is a farmer.
  01> AVERILL, Timothy Rochford m on 22.01.1977 to GRAHAM, Susan Fay
  b 07.09.1954
  b 09.09.1954
  Timothy b. and m. at Hastings. Susan, d/o Thomas Graham Jowsey (d. 1955) and Janice Perress
  Hingston. Address: Hodgson Road, RD 3, Napier.
  Timothy was educated at Maraekakaho Primary School, Hereworth School and Wanganui Collegiate
  School. He is an horticulturalist involved in orcharding, cropping and contracting.
  Susan is a primary school teacher and has been teaching at Westshore Primary School since 1987.
  01> AVERILL, Thomas Graham Rochford
  b 07.09.1983
  Thomas b. at Hastings. He is a student at Lindisfarne College.
  02> AVERILL, Sarah Lucy
  b 13.11.1985
  Sarah b. at Hastings. She is a student at Taradale Intermediate.
  02 AVERILL, Morris Hanson and BANFIELD, Mary
  b 03.07.1956
  b ** ** ****
  Address: Flat 18 36 Perry Street, Marrickville, NSW 2204, Australia.
  Morris was educated at Maraekakaho Primary School, Hereworth School, Wanganui Collegiate School and
  Victoria University (LLB) and is a lawyer. He worked for Hyndman and Co, a law firm in Sydney
  before starting his own business, Averill Media Legal Services, in Newtown in 1996. He received a
  Master of Law degree in Legal Media Communication from the University of New South Wales in 1997.
